import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { Link } from 'react-router-dom';
import logo from "../images/logo-black.png"
import "../componetns/style.css"
import menuIcon from '../images/icons8-menu-50.png'
import Button from 'react-bootstrap/Button';
import profImg from '../images/icons8-user-100.png'
import { useSelector } from 'react-redux';


function Navbares() {
    const yourInlineStyles = {
        display: 'flex',
        textDecoration: 'none',
        alignItems: 'center',
        color: 'black'
    };
    const yourInlineStyle = {
        display: 'flex',
        textDecoration: 'none',
        alignItems: 'center',
        color: 'white'
    };
    const userData = useSelector((state) => state.users?.users ?? 'Not available');
    const isLoggedIn = userData.success
    console.log();
    return (
        <div className='nav-main'>
            <Navbar expand="lg" className="bg-white " data-bs-theme="black">
                <Container>
                    <Navbar.Brand href="#home">
                        <img className='nav-logo' src={logo} alt="" />

                    </Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="me-auto">
                            <Link to={'/'} style={yourInlineStyles}><b>Home</b></Link>
                            <Nav.Link ><b>Menu</b></Nav.Link>
                            <Nav.Link ><b>Gallery</b></Nav.Link>
                            <Link style={yourInlineStyles}><b>Contact</b></Link>

                        </Nav>

                        <div className='nav-end-section'>
                            <div>
                                {isLoggedIn ?

                                    <div>
                                        <img src={profImg} className='profimg' alt="Profile" />
                                         <span className='profilName'>muhamed</span>
                                    </div>

                                    :

                                    <Link className='btn btn-dark' to={'/signup'} style={yourInlineStyle}>Signup</Link>

                                }
                            </div>
                            <Link></Link>
                            <img className='menuBar' src={menuIcon} alt="" />
                        </div>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        </div>
    )
}

export default Navbares
